import React from 'react';
import './Cadastrar.css';
import {Link} from 'react-router-dom';
import voltar from '../assets/voltar.png'




export default function Cadastrar() {
    return(
        <div>
            <h2 id="cabecalho">
                <h1>Cadastrar</h1>
                <Link to="/">
                    <button>
                        <img src={voltar} alt="Voltar"/>
                    </button>                
                </Link>
                <button></button>
                <Link to="/main">
                    <h1>Confirmar</h1>
                </Link>
            </h2>
                <form className="cadastro">
                    E-mail <br/>
                   <input type="email"/>
                </form>
        </div>
    )
};
